  false,\n\t\"url\": null,\n\t\"notes\": \"This Light Detection and Ranging (LiDAR)
  LAS dataset is a topographic survey conducted for a coalition of GIS practitioners,
  including the Florida Division of Emergency Management (FDEM), Florida Water Management
  Districts, Florida Fish and Wildlife Conservation Commission, Florida Department
  of Environmental Protection, Army Corps of Engineers Jacksonville District, and
  other state and federal agencies. The goal for this project is to use the LiDAR
  data as new elevation inputs for updated SLOSH data grids. The ultimate result is
  the update of the Regional Hurricane Evacuation Studies (RHES) for the state. The
  State of Florida Division of Emergency Management LiDAR Survey was collected under
  the guidance of a Professional Mapper/Surveyor. This is a classified lidar data
  set, bare-earth points (class 2), noise points (class 7), water returns (class 9),
  and unclassified data (class 1). Class 12 contains LiDAR points removed from the
  overlap region between adjacent flight lines. The LiDAR data was flown at a density
  sufficient to support a maximum final post spacing of 4 feet for unobscured areas.
  This data set is a collection of smaller project areas collected at different times
  in southwest Florida. Specifically, the data were collected within portions of Pinellas,
  Hillsborough, Manatee, Sarasota, Charlotte, Lee, Collier, Monroe, and a small portion
  of the coastal area of Pasco, Counties. Project Area A, also in Pasco County, is
  data from the Southwest Florida Water Management District (SWFWMD), collected in
  2004, and was not part of the FDEM collection effort. Project Area A has been added
  to this FDEM southwest Florida data set. The dates of collection are: Project Area
  A: 2004 Project Area B: 20070706-20070810 Project Area C: 20070706-20070810 Project
  Area D: 20070717-20070729 Project Area E: 20070717-20070708 Project Area F: 20070618-20070806
  Project Area G: 20070612-20070630, 20070702, 20070714, 20070804-20070805 Project
  Area H: 20070615-20070629 Lee Buy Up: 20070811-20070824 Sarasota Buy Up: 20070828-20070830
  Pasco Coastal: 20080209\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
